description.text:
Flashforge dreamer has a filament spool holder for half a kilo wheel.<br />
Made an external spool holder for 1 kilo filament.<br />
Easy to install. Is mounted on the side of the printer.   The cover needs spacers to enable the wire into the printer. Printed those spacers from another project here: &quot;FlashForge Dreamer Lid Spacer&quot;
